    :root #session .user-menu a:hover,
    :root #session .user-menu button:focus,
    :root #session .user-menu button:hover,
    :root #session .user-menu input:focus,
    :root #session .user-menu input:hover {
      color: #11111b;
      background-color: #cba6f7;
    }
    :root .notice,
    :root .notice p,
    :root h2 {
      color: #bac2de;
    }
    :root .notice.error {
      background: rgba(243, 139, 168, 0.2);
      border-color: rgba(243, 139, 168, 0.25);
    }
    :root .ResponsiveLayout--Night .PageContainer {
      background-color: #1e1e2e;
    }
    :root .list-explanation {
      color: #a6adc8;
    }
    :root .ResponsiveLayout--Night .list-btn:first-of-type {
      border-top-color: #181825;
    }
