/* ==UserStyle==
@name Google Drive Catppuccin
@namespace github.com/catppuccin/userstyles/styles/google-drive
@homepageURL https://github.com/catppuccin/userstyles/tree/main/styles/google-drive
@version 2025.09.06
@updateURL https://github.com/catppuccin/userstyles/raw/main/styles/google-drive/catppuccin.user.less
@supportURL https://github.com/catppuccin/userstyles/issues?q=is%3Aopen+is%3Aissue+label%3Agoogle-drive
@description Soothing pastel theme for Google Drive
@author Catppuccin
@license MIT

@preprocessor less
@var select lightFlavor "Light Flavor" ["latte:Latte*", "frappe:Frapp", "macchiato:Macchiato", "mocha:Mocha"]
@var select darkFlavor "Dark Flavor" ["latte:Latte", "frappe:Frapp", "macchiato:Macchiato", "mocha:Mocha*"]
@var select accentColor "Accent" ["rosewater:Rosewater", "flamingo:Flamingo", "pink:Pink", "mauve:Mauve*", "red:Red", "maroon:Maroon", "peach:Peach", "yellow:Yellow", "green:Green", "teal:Teal", "blue:Blue", "sapphire:Sapphire", "sky:Sky", "lavender:Lavender", "subtext0:Gray"]
==/UserStyle== */

@import "https://userstyles.catppuccin.com/lib/lib.less";

@-moz-document domain("drive.google.com") {
  .vhoiae {
    &.KkxPLb {
      #catppuccin(@lightFlavor);
    }

    &.LgGVmb, .yYWAMb.bvmRsc, .dif24c.bvmRsc {
      #catppuccin(@darkFlavor);
    }
  }

  #catppuccin(@flavor) {
    #lib.palette();

    // TODO: Try to make use `#lib.defaults()` here, but it causes issues with the color scheme (see below).
    // #lib.defaults(); // Color scheme is already set by Google Drive; setting it here causes bugs, and there are no known side effects as Google does not use native UI elements (which would reflect `color-scheme` state and cause potential issues).

    ::selection {
      background-color: fade(@accent, 30%);
    }

    input,
    textarea {
      &::placeholder {
        color: @subtext0 !important;
      }
    }

    --dt-on-background: @text;
    --dt-on-background-secondary: @subtext0;
    --dt-background: @base;
    --dt-on-surface: @text;
    --dt-inverse-surface: @text;
    --dt-on-surface-secondary: @subtext0;
    --dt-on-surface-variant: @text;
    --dt-surface-variant: @surface0;
    --dt-inverse-on-surface: @surface0;
    --dt-surface: @base;
    --dt-surface-tint: @accent;
    --dt-shadow-elevation-1:
      0px 3px 1px -2px fade(@base, 20%), 0px 2px 2px 0px fade(@base, 14%), 0px
      1px 5px 0px fade(@base, 12%);
    --dt-shadow-elevation-2:
      0px 2px 4px -1px fade(@base, 20%), 0px 4px 5px 0px fade(@base, 14%), 0px
      1px 10px 0px fade(@base, 12%);
    --dt-shadow-elevation-3:
      0px 5px 5px -3px fade(@base, 20%), 0px 8px 10px 1px fade(@base, 14%), 0px
      3px 14px 2px fade(@base, 12%);
    --dt-shadow-elevation-4:
      0px 5px 5px -3px fade(@base, 20%), 0px 8px 10px 1px fade(@base, 14%), 0px
      3px 14px 2px fade(@base, 12%);
    --dt-shadow-elevation-5:
      0px 8px 10px -6px fade(@base, 20%), 0px 16px 24px 2px fade(@base, 14%),
      0px 6px 30px 5px fade(@base, 12%);
    --dt-surface-container-lowest: @crust;
    --dt-surface-container-low: @mantle;
    --dt-surface-container: @surface0;
    --dt-surface-container-high: @surface1;
    --dt-surface-container-highest: @surface2;
    --dt-surface-dim: @crust;
    --dt-surface-bright: @base;
    --dt-on-primary-container: @text;
    --dt-primary-container-icon: @text;
    --dt-primary-container-link: @text;
    --dt-primary: @accent;
    --dt-primary-action: @accent;
    --dt-primary-action-stateful: @accent;
    --dt-primary-outline: @accent;
    --dt-primary-action-state-layer: @accent;
    --dt-primary-container: @surface0;
    --dt-on-primary: @base;
    --dt-primary-icon: @base;
    --dt-primary-link: @base;
    --dt-on-secondary-container: @text;
    --dt-secondary-container-icon: @text;
    --dt-secondary-container-link: @text;
    --dt-secondary: @accent;
    --dt-secondary-action: @accent;
    --dt-secondary-action-stateful: @accent;
    --dt-secondary-outline: @accent;
    --dt-secondary-action-state-layer: @accent;
    --dt-secondary-container: @surface0;
    --dt-on-secondary: @base;
    --dt-secondary-icon: @base;
    --dt-secondary-link: @base;
    --dt-on-tertiary-container: @text;
    --dt-tertiary-container-icon: @text;
    --dt-tertiary-container-link: @text;
    --dt-tertiary: @accent;
    --dt-tertiary-action: @accent;
    --dt-tertiary-action-stateful: @accent;
    --dt-tertiary-outline: @accent;
    --dt-tertiary-action-state-layer: @accent;
    --dt-tertiary-container: @surface0;
    --dt-on-tertiary: @base;
    --dt-tertiary-icon: @base;
    --dt-tertiary-link: @base;
    --dt-on-neutral-container: @text;
    --dt-neutral-container-icon: @text;
    --dt-neutral-container-link: @text;
    --dt-neutral: @surface0;
    --dt-neutral-action: @text;
    --dt-neutral-action-stateful: @text;
    --dt-neutral-outline: @surface0;
    --dt-neutral-action-state-layer: @surface0;
    --dt-neutral-container: @surface0;
    --dt-on-neutral: @text;
    --dt-neutral-icon: @surface0;
    --dt-neutral-link: @surface0;
    --dt-on-warning-container: @yellow;
    --dt-warning-container-icon: @yellow;
    --dt-warning-container-link: @yellow;
    --dt-warning: @yellow;
    --dt-warning-action: @yellow;
    --dt-warning-action-stateful: @yellow;
    --dt-warning-outline: @yellow;
    --dt-warning-action-state-layer: @yellow;
    --dt-warning-container: @surface0;
    --dt-on-warning: @base;
    --dt-warning-icon: @yellow;
    --dt-warning-link: @yellow;
    --dt-on-error-container: @red;
    --dt-error-container-icon: @red;
    --dt-error-container-link: @red;
    --dt-error: @red;
    --dt-error-action: @red;
    --dt-error-action-stateful: @red;
    --dt-error-outline: @red;
    --dt-error-action-state-layer: @surface1;
    --dt-error-container: @surface1;
    --dt-on-error: @base;
    --dt-error-icon: @base;
    --dt-error-link: @base;
    --dt-mime-type-blue: @blue;
    --dt-mime-type-dark-blue: @blue;
    --dt-mime-type-green: @green;
    --dt-mime-type-grey: @overlay0;
    --dt-mime-type-purple: @mauve;
    --dt-mime-type-deep-purple: @mauve;
    --dt-mime-type-red: @red;
    --dt-mime-type-yellow: @yellow;
    --dt-disabled: @overlay0;
    --dt-on-disabled: @text;
    --dt-outline: @overlay0;
    --dt-outline-variant: @surface2;
    --dt-light-info-banner-button: @text;
    --dt-light-neutral-banner-button: @text;
    --dt-light-success-banner-button: @green;
    --dt-light-warning-banner-button: @yellow;
    --dt-light-error-banner-button: @red;

    --gm3-sys-color-background: @base;
    --gm3-sys-color-background-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-error: @red;
    --gm3-sys-color-error-rgb: #lib.rgbify(@red)[];
    --gm3-sys-color-error-container: @surface2;
    --gm3-sys-color-error-container-rgb: #lib.rgbify(@surface2)[];
    --gm3-sys-color-inverse-on-surface: @surface0;
    --gm3-sys-color-inverse-on-surface-rgb: #lib.rgbify(@surface0)[];
    --gm3-sys-color-inverse-primary: red;
    --gm3-sys-color-inverse-primary-rgb: 255, 0, 0;
    --gm3-sys-color-inverse-surface: @text;
    --gm3-sys-color-inverse-surface-rgb: #lib.rgbify(@text)[];
    --gm3-sys-color-on-background: @text;
    --gm3-sys-color-on-background-rgb: #lib.rgbify(@text)[];
    --gm3-sys-color-on-error: @base;
    --gm3-sys-color-on-error-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-on-error-container: @red;
    --gm3-sys-color-on-error-container-rgb: #lib.rgbify(@red)[];
    --gm3-sys-color-on-primary: @base;
    --gm3-sys-color-on-primary-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-on-primary-container: @text;
    --gm3-sys-color-on-primary-container-rgb: #lib.rgbify(@text)[];
    --gm3-sys-color-on-primary-fixed: @base;
    --gm3-sys-color-on-primary-fixed-rgb: #lib.rgbify(@base);
    --gm3-sys-color-on-primary-fixed-variant: @base;
    --gm3-sys-color-on-primary-fixed-variant-rgb: #lib.rgbify(@base);
    --gm3-sys-color-on-secondary: @base;
    --gm3-sys-color-on-secondary-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-on-secondary-container: @text;
    --gm3-sys-color-on-secondary-container-rgb: #lib.rgbify(@text)[];
    --gm3-sys-color-on-secondary-fixed: @base;
    --gm3-sys-color-on-secondary-fixed-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-on-secondary-fixed-variant: @base;
    --gm3-sys-color-on-secondary-fixed-variant-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-on-surface: @text;
    --gm3-sys-color-on-surface-rgb: #lib.rgbify(@text)[];
    --gm3-sys-color-on-surface-variant: @text;
    --gm3-sys-color-on-surface-variant-rgb: #lib.rgbify(@text)[];
    --gm3-sys-color-on-tertiary: @base;
    --gm3-sys-color-on-tertiary-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-on-tertiary-container: @text;
    --gm3-sys-color-on-tertiary-container-rgb: #lib.rgbify(@text)[];
    --gm3-sys-color-on-tertiary-fixed: @base;
    --gm3-sys-color-on-tertiary-fixed-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-on-tertiary-fixed-variant: @base;
    --gm3-sys-color-on-tertiary-fixed-variant-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-outline: @overlay0;
    --gm3-sys-color-outline-rgb: #lib.rgbify(@overlay0)[];
    --gm3-sys-color-outline-variant: @surface2;
    --gm3-sys-color-outline-variant-rgb: #lib.rgbify(@surface2)[];
    --gm3-sys-color-primary: @accent;
    --gm3-sys-color-primary-rgb: #lib.rgbify(@accent)[];
    --gm3-sys-color-primary-container: @surface0;
    --gm3-sys-color-primary-container-rgb: #lib.rgbify(@surface0)[];
    --gm3-sys-color-primary-fixed: @accent;
    --gm3-sys-color-primary-fixed-rgb: #lib.rgbify(@accent)[];
    --gm3-sys-color-primary-fixed-dim: @accent;
    --gm3-sys-color-primary-fixed-dim-rgb: #lib.rgbify(@accent)[];
    --gm3-sys-color-secondary: @accent;
    --gm3-sys-color-secondary-rgb: #lib.rgbify(@accent);
    --gm3-sys-color-secondary-container: @surface0;
    --gm3-sys-color-secondary-container-rgb: #lib.rgbify(@surface0)[];
    --gm3-sys-color-secondary-fixed: #c2e7ff;
    --gm3-sys-color-secondary-fixed-rgb: 194, 231, 255;
    --gm3-sys-color-secondary-fixed-dim: #7fcfff;
    --gm3-sys-color-secondary-fixed-dim-rgb: 127, 207, 255;
    --gm3-sys-color-surface: @base;
    --gm3-sys-color-surface-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-surface-bright: @base;
    --gm3-sys-color-surface-bright-rgb: #lib.rgbify(@base)[];
    --gm3-sys-color-surface-container: @surface0;
    --gm3-sys-color-surface-container-rgb: #lib.rgbify(@surface0)[];
    --gm3-sys-color-surface-container-high: @surface1;
    --gm3-sys-color-surface-container-high-rgb: #lib.rgbify(@surface1)[];
    --gm3-sys-color-surface-container-highest: @surface2;
    --gm3-sys-color-surface-container-highest-rgb: #lib.rgbify(@surface2)[];
    --gm3-sys-color-surface-container-low: @mantle;
    --gm3-sys-color-surface-container-low-rgb: #lib.rgbify(@mantle)[];
    --gm3-sys-color-surface-container-lowest: @crust;
    --gm3-sys-color-surface-container-lowest-rgb: #lib.rgbify(@crust)[];
    --gm3-sys-color-surface-dim: @crust;
    --gm3-sys-color-surface-dim-rgb: #lib.rgbify(@crust)[];
    --gm3-sys-color-surface-tint: @accent;
    --gm3-sys-color-surface-tint-rgb: #lib.rgbify(@accent)[];
    --gm3-sys-color-surface-variant: @surface0;
    --gm3-sys-color-surface-variant-rgb: #lib.rgbify(@surface0)[];
    --gm3-sys-color-tertiary: @accent;
    --gm3-sys-color-tertiary-rgb: #lib.rgbify(@accent)[];
    --gm3-sys-color-tertiary-container: @surface0;
    --gm3-sys-color-tertiary-container-rgb: #lib.rgbify(@surface0);
    --gm3-sys-color-tertiary-fixed: @accent;
    --gm3-sys-color-tertiary-fixed-rgb: #lib.rgbify(@accent)[];
    --gm3-sys-color-tertiary-fixed-dim: @accent;
    --gm3-sys-color-tertiary-fixed-dim-rgb: #lib.rgbify(@accent)[];

    & when (@flavor = latte) {
      --dt-scrim: fade(@text, 50%);
      --dt-scrim-2x: fade(@text, 50%);
      --gm3-sys-color-scrim: @text;
      --gm3-sys-color-scrim-rgb: #lib.rgbify(@text)[];
      --gm3-sys-color-shadow: @text;
      --gm3-sys-color-shadow-rgb: #lib.rgbify(@text)[];
    }

    & when not(@flavor = latte) {
      --dt-scrim: fade(@base, 50%);
      --dt-scrim-2x: fade(@base, 50%);
      --gm3-sys-color-scrim: @base;
      --gm3-sys-color-scrim-rgb: #lib.rgbify(@base)[];
      --gm3-sys-color-shadow: @base;
      --gm3-sys-color-shadow-rgb: #lib.rgbify(@base)[];
    }

    /* Settings menu title & back button */
    .gb_Pc svg,
    .gb_Uc.gb_Zc svg,
    .gb_Pc .gb_gd .gb_od,
    .gb_Pc .gb_gd .gb_Oc,
    .gb_Pc .gb_gd .gb_id,
    .gb_Uc.gb_Zc .gb_od {
      color: @text !important;
    }

    /* Settings menu Storage total used icon */
    .VBJTHe svg path {
      fill: @text;
    }

