  html.theme--dark div[style*="background-color: rgb(91, 119, 149)"] {
    background-color: #585b70 !important;
  }
  html.theme--dim div[style*="border-color: rgb(120, 142, 165)"],
  html.theme--dark div[style*="border-color: rgb(120, 142, 165)"] {
    border-color: #7f849c !important;
  }

