/* ==UserStyle==
@name Learn X in Y Minutes Catppuccin
@namespace github.com/catppuccin/userstyles/styles/learn-x-in-y-minutes
@homepageURL https://github.com/catppuccin/userstyles/tree/main/styles/learn-x-in-y-minutes
@version 2025.09.06
@updateURL https://github.com/catppuccin/userstyles/raw/main/styles/learn-x-in-y-minutes/catppuccin.user.less
@supportURL https://github.com/catppuccin/userstyles/issues?q=is%3Aopen+is%3Aissue+label%3Alearn-x-in-y-minutes
@description Soothing pastel theme for Learn X in Y Minutes
@author Catppuccin
@license MIT

@preprocessor less
@var select lightFlavor "Light Flavor" ["latte:Latte*", "frappe:Frapp", "macchiato:Macchiato", "mocha:Mocha"]
@var select darkFlavor "Dark Flavor" ["latte:Latte", "frappe:Frapp", "macchiato:Macchiato", "mocha:Mocha*"]
@var select accentColor "Accent" ["rosewater:Rosewater", "flamingo:Flamingo", "pink:Pink", "mauve:Mauve*", "red:Red", "maroon:Maroon", "peach:Peach", "yellow:Yellow", "green:Green", "teal:Teal", "blue:Blue", "sapphire:Sapphire", "sky:Sky", "lavender:Lavender", "subtext0:Gray"]
==/UserStyle== */

@import "https://userstyles.catppuccin.com/lib/lib.less";

@-moz-document domain("learnxinyminutes.com") {
  @import url("https://python.catppuccin.com/pygments/catppuccin-variables.important.css");

  html.light {
    #catppuccin(@lightFlavor);
  }

  html.dark {
    #catppuccin(@darkFlavor);
  }

  html:not(.dark, .light) {
    @media (prefers-color-scheme: light) {
      #catppuccin(@lightFlavor);
    }
    @media (prefers-color-scheme: dark) {
      #catppuccin(@darkFlavor);
    }
  }

  #catppuccin(@flavor) {
    #lib.palette();
    #lib.defaults();
    #lib.css-variables();

    .highlight {
      background-color: @mantle;

      pre {
        background-color: @mantle !important;
      }
    }

    &:not(.dark, .light) {
      p {
        color: @subtext0 !important;
      }

      span {
        color: @text;
      }
    }

    .share {
      background-color: @mantle;
      border-color: @crust;

      &:hover {
        background-color: @surface0;
      }
    }

    .theme-choice button {
      color: @text;
      background-color: @mantle;
      border-color: @crust;

      &:hover {
        background-color: @surface0;
      }
    }

    #lang-select {
      color: @text;
      background-color: @mantle;
      border-color: @crust;
    }

    td.lang span a {
      color: @text;
      background-color: @mantle;
      border-color: @crust;

      &:hover {
        background-color: @surface0;
      }
    }

    &,
    body {
      background-color: @base;
      color: @text;
      border-color: @base;
      box-shadow: none;
    }

    td,
    th {
      color: @text;
      border-bottom-color: @surface0;
    }

    footer {
      p {
        color: @subtext1;
      }
    }

    a {
      color: @accent !important;

      code {
        color: @accent !important;
      }

      &:visited {
        color: darken(@accent, 5%) !important;
      }

      &.active {
        color: @base !important;
        background-color: @accent !important;
        border-color: darken(@accent, 15%) !important;

        &:visited {
          background-color: darken(@accent, 5%) !important;
          color: @base !important;
          border-color: darken(@accent, 10%) !important;
        }
      }
    }

    hr {
      border-color: @surface1;
    }

    code {
      background-color: @mantle;
      color: @text;
    }
  }
}

