/* ==UserStyle==
@name PyPI Catppuccin
@namespace github.com/catppuccin/userstyles/styles/pypi
@homepageURL https://github.com/catppuccin/userstyles/tree/main/styles/pypi
@version 2025.09.06
@updateURL https://github.com/catppuccin/userstyles/raw/main/styles/pypi/catppuccin.user.less
@supportURL https://github.com/catppuccin/userstyles/issues?q=is%3Aopen+is%3Aissue+label%3Apypi
@description Soothing pastel theme for PyPI
@author Catppuccin
@license MIT

@preprocessor less
@var select lightFlavor "Light Flavor" ["latte:Latte*", "frappe:Frapp", "macchiato:Macchiato", "mocha:Mocha"]
@var select darkFlavor "Dark Flavor" ["latte:Latte", "frappe:Frapp", "macchiato:Macchiato", "mocha:Mocha*"]
@var select accentColor "Accent" ["rosewater:Rosewater", "flamingo:Flamingo", "pink:Pink", "mauve:Mauve*", "red:Red", "maroon:Maroon", "peach:Peach", "yellow:Yellow", "green:Green", "teal:Teal", "blue:Blue", "sapphire:Sapphire", "sky:Sky", "lavender:Lavender", "subtext0:Gray"]
==/UserStyle== */
/* deno-fmt-ignore */
/* deno-fmt-ignore */

@import url("https://python.catppuccin.com/pygments/catppuccin-variables.important.css");
  @media (prefers-color-scheme: light) {
    :root {
      color-scheme: light;
      --ctp-rosewater: #dc8a78;
      --ctp-flamingo: #dd7878;
      --ctp-pink: #ea76cb;
      --ctp-mauve: #8839ef;
      --ctp-red: #d20f39;
      --ctp-maroon: #e64553;
      --ctp-peach: #fe640b;
      --ctp-yellow: #df8e1d;
      --ctp-green: #40a02b;
      --ctp-teal: #179299;
      --ctp-sky: #04a5e5;
      --ctp-sapphire: #209fb5;
      --ctp-blue: #1e66f5;
      --ctp-lavender: #7287fd;
      --ctp-text: #4c4f69;
      --ctp-subtext1: #5c5f77;
      --ctp-subtext0: #6c6f85;
      --ctp-overlay2: #7c7f93;
      --ctp-overlay1: #8c8fa1;
      --ctp-overlay0: #9ca0b0;
      --ctp-surface2: #acb0be;
      --ctp-surface1: #bcc0cc;
      --ctp-surface0: #ccd0da;
      --ctp-base: #eff1f5;
      --ctp-mantle: #e6e9ef;
      --ctp-crust: #dce0e8;
    }
    :root ::selection {
      background-color: rgba(136, 57, 239, 0.3);
    }
    :root input::placeholder,
    :root textarea::placeholder {
      color: #6c6f85 !important;
    }
    :root ::selection {
      color: unset;
    }
    :root body {
      background-color: #eff1f5 !important;
      color: #4c4f69 !important;
    }
    :root input,
    :root select,
    :root textarea {
      background-color: #e6e9ef !important;
      border-color: #ccd0da !important;
      color: #4c4f69 !important;
    }
    :root input:active,
    :root select:active,
    :root textarea:active,
    :root input:focus,
    :root select:focus,
    :root textarea:focus,
    :root input:hover,
    :root select:hover,
    :root textarea:hover {
      border-color: #8839ef !important;
      box-shadow: inset 0 0 0 1px #8839ef !important;
    }
    :root input:disabled,
    :root select:disabled,
    :root input:disabled:active,
    :root select:disabled:active,
    :root input:disabled:focus,
    :root select:disabled:focus,
    :root input:disabled:hover,
    :root select:disabled:hover {
      background-color: #e6e9ef !important;
    }
    :root hr {
      background-color: #ccd0da !important;
      background-image: linear-gradient(90deg, #ccd0da, #ccd0da) !important;
    }
    :root .project-description blockquote {
      color: #6c6f85 !important;
    }
    :root .project-description table tr {
      background-color: #eff1f5 !important;
    }
    :root .project-description table tr:nth-child(odd) {
      background-color: #e6e9ef !important;
    }
    :root .project-description table,
    :root .project-description table tr,
    :root .project-description table th,
    :root .project-description table td {
      border-color: #ccd0da !important;
    }
    :root .verified .check {
      color: #40a02b;
    }
    :root .banner,
    :root .footer {
      background-color: #e6e9ef !important;
