    }
    :root .table--files tbody tr td:first-child,
    :root .table--files tbody tr th:first-child,
    :root .table--history tbody tr td:first-child,
    :root .table--history tbody tr th:first-child,
    :root .table--downloads tbody tr td:first-child,
    :root .table--downloads tbody tr th:first-child {
      border-top-color: #a6adc8 !important;
    }
  }
  @media (prefers-color-scheme: dark) and (max-width: 400px) {
    :root .table--hashes {
      border-bottom-color: #a6adc8 !important;
    }
    :root .table--hashes tbody tr td:first-child,
    :root .table--hashes tbody tr th:first-child {
      border-top-color: #a6adc8 !important;
    }
    :root .table--hashes td .button::before {
      border-color: transparent !important;
    }
  }
  @media (prefers-color-scheme: dark) and (max-width: 800px) {
    :root .vertical-tabs__tab--mobile,
    :root .vertical-tabs__tab--mobile:last-of-type {
      border-bottom-color: #313244 !important;
    }
  }
  @media (prefers-color-scheme: dark) and (min-width: 801px) {
    :root .package-snippet,
    :root .package-snippet:hover {
      background-image: url("data:image/svg+xml;utf8,%3Csvg%20xmlns%3D%22http%3A//www.w3.org/2000/svg%22%20width%3D%2240%22%20height%3D%2238%22%20viewBox%3D%220%200%2037.5%2035.625%22%3E%3Cg%20stroke%3D%22%23313244%22%20stroke-linejoin%3D%22bevel%22%20stroke-width%3D%22.211%22%3E%3Cpath%20fill%3D%22%23585b70%22%20d%3D%22m9.526%205.025%209.233%203.36%209.37-3.41-9.233-3.361z%22/%3E%3Cpath%20fill%3D%22%2345475a%22%20d%3D%22M18.759%208.385v10.852l9.37-3.41V4.975z%22/%3E%3Cpath%20fill%3D%22%23585b70%22%20d%3D%22m9.526%205.025%209.233%203.36v10.852l-9.233-3.361z%22/%3E%3Cpath%20fill%3D%22%23585b70%22%20d%3D%22m.215%2019.303%209.233%203.36%209.37-3.41-9.233-3.361z%22/%3E%3Cpath%20fill%3D%22%2345475a%22%20d%3D%22M9.448%2022.663v10.852l9.37-3.41V19.253z%22/%3E%3Cpath%20fill%3D%22%23585b70%22%20d%3D%22m.215%2019.303%209.233%203.36v10.852L.215%2030.154z%22/%3E%3Cpath%20fill%3D%22%23585b70%22%20d%3D%22m18.713%2019.303%209.233%203.36%209.37-3.41-9.233-3.361z%22/%3E%3Cpath%20fill%3D%22%2345475a%22%20d%3D%22M27.946%2022.663v10.852l9.37-3.41V19.253z%22/%3E%3Cpath%20fill%3D%22%23585b70%22%20d%3D%22m18.713%2019.303%209.233%203.36v10.852l-9.233-3.361z%22/%3E%3C/g%3E%3C/svg%3E") !important;
